import React, { useState, useEffect } from 'react';
import axios from 'axios'; // Assurez-vous d'avoir axios installé : npm install axios
import Popup from 'reactjs-popup'; // Import de reactjs-popup
import 'reactjs-popup/dist/index.css'; // Import du style de reactjs-popup
import '../styles/profile.css';

export default function Profile() {
    const [userData, setUserData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        mobileNumber: '',
        addressLine1: '',
        addressLine2: '',
        postcode: '',
        state: '',
        country: ''
    });

    useEffect(() => {
        // Ici, vous devriez faire une requête HTTP à votre backend pour récupérer les données de l'utilisateur
        // Remplacez l'URL par l'URL de votre endpoint backend
        axios.get('URL_VERS_VOTRE_ENDPOINT_BACKEND')
            .then(response => {
                // Mettez à jour l'état avec les données de l'utilisateur obtenues du backend
                setUserData(response.data);
            })
            .catch(error => {
                console.error('Erreur lors de la récupération des données utilisateur :', error);
            });
    }, []); // Le tableau vide assure que cette requête est effectuée une seule fois après le premier rendu

    const handleChange = (e, key) => {
        const { value } = e.target;
        setUserData(prevState => ({
            ...prevState,
            [key]: value
        }));
    };

    return (
        <div className="profile-container rounded bg-white mt-5 mb-5">
            <div className="row">
                <div className="col-md-6 border-right">
                    <div className="profile-info">
                        <div className="d-flex justify-content-between align-items-center mb-3">
                            <h4 className="text-right">Profile Settings</h4>
                        </div>
                        <div className="row mt-2">
                            <div className="col-md-6">
                                <label className="labels">First Name</label>
<Popup trigger={<input type="text" />} modal>
  {close => (
    <div>
      {/* Contenu de votre popup ici */}
      {/* Vous pouvez utiliser les mêmes inputs que dans votre formulaire */}
      <button onClick={close}>Fermer</button>
    </div>
  )}
</Popup>


                                </div>
                            <div className="col-md-6"><label className="labels">Last Name</label><input type="text" className="form-control" name="lastName" placeholder="Last name" value={userData.lastName} readOnly /></div>
                        </div>
                        <div className="row mt-3">
                            <div className="col-md-12"><label className="labels">Email</label><input type="email" className="form-control" name="email" placeholder="Email" value={userData.email} readOnly /></div>
                            <div className="col-md-12"><label className="labels">Mobile Number</label><input type="text" className="form-control" name="mobileNumber" placeholder="Mobile number" value={userData.mobileNumber} readOnly /></div>
                            <div className="col-md-12"><label className="labels">Address Line 1</label><input type="text" className="form-control" name="addressLine1" placeholder="Address Line 1" value={userData.addressLine1} readOnly /></div>
                            <div className="col-md-12"><label className="labels">Address Line 2</label><input type="text" className="form-control" name="addressLine2" placeholder="Address Line 2" value={userData.addressLine2} readOnly /></div>
                            <div className="col-md-12"><label className="labels">Postcode</label><input type="text" className="form-control" name="postcode" placeholder="Postcode" value={userData.postcode} readOnly /></div>
                            <div className="col-md-12"><label className="labels">State</label><input type="text" className="form-control" name="state" placeholder="State" value={userData.state} readOnly /></div>
                            <div className="col-md-12"><label className="labels">Country</label><input type="text" className="form-control" name="country" placeholder="Country" value={userData.country} readOnly /></div>
                        </div>
                    </div>
                </div>
                <div className="col-md-6">
                    <Popup trigger={<button className="btn btn-primary">Modifier </button>} modal>
                        {close => (
                            <div className="modal">
                                <button className="close" onClick={close}>
                                    &times;
                                </button>
                                <div className="header">Modifier les informations</div>
                                <div className="content">
                                    {/* Formulaire de modification ici */}
                                    {/* Assurez-vous d'utiliser handleChange pour mettre à jour l'état */}
                                </div>
                            </div>
                        )}
                    </Popup>
                </div>
            </div>
        </div>
    );
}
